/** @format */

function Team() {
	return (
		<>
			<div className='container px-14 pt-40 xl:pt-60 mx-auto '>
				<h2 className='big-title'>오늘의집에서 일 한다는 것</h2>
				<img
					className=' w-1/2 hover:w-full'
					src='https://team.daangn.com/static/ef5b621725b6ecd6d35f063a503bf67a/66698/125e51c5-e9e4-4f0b-a20c-681fb23fcfa6_photo_16.avif'
				/>
				<p className='base-text w-4/5'>
					오늘의집 팀은 최소한의 규칙으로 최대한의 자유를 보장하는 것을 원칙으로
					하는 만큼 우리 모두가 스스로의 생각과 행동에 대한 막중한 책임감을
					가지고 임합니다. 다음의 일곱가지는 이러한 원칙을 기반으로 만들어진
					오늘의집의 일하는 방식이며 근본적인 가치입니다.
				</p>
			</div>
		</>
	);
}

export default Team;
